useEffect(() => {
    fetch(`https://community-open-weather-map.p.rapidapi.com/forecast?q=vancouver&units=metric`, {
        "method": "GET",
        "headers": {
            "x-rapidapi-key": "e67776521cmshd88d4bf5e0c8e46p16cc0fjsn0bd91cdc12f0",
            "x-rapidapi-host": "community-open-weather-map.p.rapidapi.com"
        }
    })
    //response.list.filter(reading => reading.dt_txt.includes("18:00:00"))))
    .then(res => res.json())
    .then(response => {
        console.log(response)
        setForecasts(response.data)
    })
    .catch(err => {
        console.log(err.message);
    });
})

    return (
        <div>
            <ul>
                {forecasts.map(forecast => (
                    <li key={forecast.city.id}>{forecast.city.title}</li>
                ))}
            </ul>

        </div>
    )
}

export default FiveDayForecastTest
